dg_read_field_def_p_task_goal(<<1:1, X:7, Rest/binary>>,
			      N, Acc, F@_1, F@_2, F@_3, F@_4, F@_5, TrUserData)
    when N < 32 - 7 ->
    dg_read_field_def_p_task_goal(Rest, N + 7,
				  X bsl N + Acc, F@_1, F@_2, F@_3, F@_4, F@_5,
				  TrUserData);
dg_read_field_def_p_task_goal(<<0:1, X:7, Rest/binary>>,
			      N, Acc, F@_1, F@_2, F@_3, F@_4, F@_5,
			      TrUserData) ->
    Key = X bsl N + Acc,
    case Key of
      8 ->
	  d_field_p_task_goal_event(Rest, 0, 0, F@_1, F@_2, F@_3,
				    F@_4, F@_5, TrUserData);
      16 ->
	  d_field_p_task_goal_target(Rest, 0, 0, F@_1, F@_2, F@_3,
				     F@_4, F@_5, TrUserData);
      24 ->
	  d_field_p_task_goal_amount(Rest, 0, 0, F@_1, F@_2, F@_3,
				     F@_4, F@_5, TrUserData);
      32 ->
	  d_field_p_task_goal_scene(Rest, 0, 0, F@_1, F@_2, F@_3,
				    F@_4, F@_5, TrUserData);
      40 ->
	  d_field_p_task_goal_findway(Rest, 0, 0, F@_1, F@_2,
				      F@_3, F@_4, F@_5, TrUserData);
      _ ->
	  case Key band 7 of
	    0 ->
		skip_varint_p_task_goal(Rest, 0, 0, F@_1, F@_2, F@_3,
					F@_4, F@_5, TrUserData);
	    1 ->
		skip_64_p_task_goal(Rest, 0, 0, F@_1, F@_2, F@_3, F@_4,
				    F@_5, TrUserData);
	    2 ->
		skip_length_delimited_p_task_goal(Rest, 0, 0, F@_1,
						  F@_2, F@_3, F@_4, F@_5,
						  TrUserData);
	    3 ->
		skip_group_p_task_goal(Rest, Key bsr 3, 0, F@_1, F@_2,
				       F@_3, F@_4, F@_5, TrUserData);
	    5 ->
		skip_32_p_task_goal(Rest, 0, 0, F@_1, F@_2, F@_3, F@_4,
				    F@_5, TrUserData)
	  end
    end;
