verify_msg(Msg) when tuple_size(Msg) >= 1 ->
    verify_msg(Msg, element(1, Msg), []);
verify_msg(X) ->
    mk_type_error(not_a_known_message, X, []).

verify_msg(Msg, MsgName) when is_atom(MsgName) ->
    verify_msg(Msg, MsgName, []);
verify_msg(Msg, Opts) when tuple_size(Msg) >= 1 ->
    verify_msg(Msg, element(1, Msg), Opts);
verify_msg(X, _Opts) ->
    mk_type_error(not_a_known_message, X, []).

verify_msg(Msg, MsgName, Opts) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case MsgName of
      m_task_list_tos ->
	  v_msg_m_task_list_tos(Msg, [MsgName], TrUserData);
      m_task_list_toc ->
	  v_msg_m_task_list_toc(Msg, [MsgName], TrUserData);
      m_task_accept_tos ->
	  v_msg_m_task_accept_tos(Msg, [MsgName], TrUserData);
      m_task_accept_toc ->
	  v_msg_m_task_accept_toc(Msg, [MsgName], TrUserData);
      m_task_submit_tos ->
	  v_msg_m_task_submit_tos(Msg, [MsgName], TrUserData);
      m_task_submit_toc ->
	  v_msg_m_task_submit_toc(Msg, [MsgName], TrUserData);
      m_task_quick_tos ->
	  v_msg_m_task_quick_tos(Msg, [MsgName], TrUserData);
      m_task_quick_toc ->
	  v_msg_m_task_quick_toc(Msg, [MsgName], TrUserData);
      m_task_update_toc ->
	  v_msg_m_task_update_toc(Msg, [MsgName], TrUserData);
      m_task_reward_tos ->
	  v_msg_m_task_reward_tos(Msg, [MsgName], TrUserData);
      m_task_reward_toc ->
	  v_msg_m_task_reward_toc(Msg, [MsgName], TrUserData);
      p_task -> v_msg_p_task(Msg, [MsgName], TrUserData);
      p_task_goal ->
	  v_msg_p_task_goal(Msg, [MsgName], TrUserData);
      _ -> mk_type_error(not_a_known_message, Msg, [])
    end.


