    [m_task_list_tos, m_task_list_toc, m_task_accept_tos,
     m_task_accept_toc, m_task_submit_tos, m_task_submit_toc,
     m_task_quick_tos, m_task_quick_toc, m_task_update_toc,
     m_task_reward_tos, m_task_reward_toc, p_task,
     p_task_goal].


get_enum_names() -> [].


fetch_msg_def(MsgName) ->
    case find_msg_def(MsgName) of
      Fs when is_list(Fs) -> Fs;
      error -> erlang:error({no_such_msg, MsgName})
    end.


-spec fetch_enum_def(_) -> no_return().
fetch_enum_def(EnumName) ->
    erlang:error({no_such_enum, EnumName}).


find_msg_def(m_task_list_tos) -> [];
find_msg_def(m_task_list_toc) ->
    [#field{name = tasks, fnum = 1, rnum = 2,
	    type = {msg, p_task}, occurrence = repeated, opts = []},
     #field{name = next, fnum = 2, rnum = 3, type = int32,
	    occurrence = required, opts = []}];
find_msg_def(m_task_accept_tos) ->
    [#field{name = task_id, fnum = 1, rnum = 2,
	    type = int32, occurrence = required, opts = []}];
find_msg_def(m_task_accept_toc) ->
    [#field{name = task, fnum = 1, rnum = 2,
	    type = {msg, p_task}, occurrence = required,
	    opts = []}];
find_msg_def(m_task_submit_tos) ->
    [#field{name = task_id, fnum = 1, rnum = 2,
	    type = int32, occurrence = required, opts = []}];
find_msg_def(m_task_submit_toc) ->
    [#field{name = task_id, fnum = 1, rnum = 2,
	    type = int32, occurrence = required, opts = []}];
find_msg_def(m_task_quick_tos) ->
    [#field{name = task_id, fnum = 1, rnum = 2,
	    type = int32, occurrence = required, opts = []}];
find_msg_def(m_task_quick_toc) ->
    [#field{name = task_id, fnum = 1, rnum = 2,
	    type = int32, occurrence = required, opts = []}];
find_msg_def(m_task_update_toc) ->
    [#field{name = add, fnum = 1, rnum = 2,
	    type = {msg, p_task}, occurrence = repeated, opts = []},
     #field{name = chg, fnum = 2, rnum = 3,
	    type = {msg, p_task}, occurrence = repeated, opts = []},
     #field{name = del, fnum = 3, rnum = 4, type = int32,
	    occurrence = repeated, opts = []},
     #field{name = next, fnum = 4, rnum = 5, type = int32,
	    occurrence = optional, opts = []}];
find_msg_def(m_task_reward_tos) ->
    [#field{name = chapter, fnum = 1, rnum = 2,
	    type = int32, occurrence = required, opts = []}];
find_msg_def(m_task_reward_toc) -> [];
find_msg_def(p_task) ->
    [#field{name = id, fnum = 1, rnum = 2, type = int32,
	    occurrence = required, opts = []},
     #field{name = prog, fnum = 2, rnum = 3, type = int32,
	    occurrence = required, opts = []},
     #field{name = count, fnum = 3, rnum = 4, type = int32,
	    occurrence = required, opts = []},
     #field{name = state, fnum = 4, rnum = 5, type = int32,
	    occurrence = required, opts = []},
     #field{name = etime, fnum = 5, rnum = 6, type = int32,
	    occurrence = required, opts = []},
     #field{name = goal, fnum = 6, rnum = 7,
	    type = {msg, p_task_goal}, occurrence = repeated,
	    opts = []}];
find_msg_def(p_task_goal) ->
    [#field{name = event, fnum = 1, rnum = 2, type = int32,
	    occurrence = required, opts = []},
     #field{name = target, fnum = 2, rnum = 3, type = int32,
	    occurrence = required, opts = []},
     #field{name = amount, fnum = 3, rnum = 4, type = int32,
	    occurrence = required, opts = []},
     #field{name = scene, fnum = 4, rnum = 5, type = int32,
	    occurrence = required, opts = []},
     #field{name = findway, fnum = 5, rnum = 6, type = bool,
	    occurrence = required, opts = []}];
find_msg_def(_) -> error.


find_enum_def(_) -> error.


-spec enum_symbol_by_value(_, _) -> no_return().
enum_symbol_by_value(E, V) ->
    erlang:error({no_enum_defs, E, V}).


-spec enum_value_by_symbol(_, _) -> no_return().
enum_value_by_symbol(E, V) ->
    erlang:error({no_enum_defs, E, V}).



get_service_names() -> [].


get_service_def(_) -> error.


get_rpc_names(_) -> error.


find_rpc_def(_, _) -> error.



-spec fetch_rpc_def(_, _) -> no_return().
fetch_rpc_def(ServiceName, RpcName) ->
    erlang:error({no_such_rpc, ServiceName, RpcName}).


%% Convert a a fully qualified (ie with package name) service name
%% as a binary to a service name as an atom.
-spec fqbin_to_service_name(_) -> no_return().
fqbin_to_service_name(X) ->
    error({gpb_error, {badservice, X}}).


%% Convert a service name as an atom to a fully qualified

%% (ie with package name) name as a binary.
-spec service_name_to_fqbin(_) -> no_return().
service_name_to_fqbin(X) ->
    error({gpb_error, {badservice, X}}).


%% Convert a a fully qualified (ie with package name) service name
%% and an rpc name, both as binaries to a service name and an rpc
%% name, as atoms.
-spec fqbins_to_service_and_rpc_name(_, _) -> no_return().
fqbins_to_service_and_rpc_name(S, R) ->
    error({gpb_error, {badservice_or_rpc, {S, R}}}).


%% Convert a service name and an rpc name, both as atoms,
%% to a fully qualified (ie with package name) service name and
%% an rpc name as binaries.
-spec service_and_rpc_name_to_fqbins(_, _) -> no_return().
service_and_rpc_name_to_fqbins(S, R) ->
    error({gpb_error, {badservice_or_rpc, {S, R}}}).


get_package_name() -> undefined.


%% Whether or not the message names
%% are prepended with package name or not.
uses_packages() -> false.



gpb_version_as_string() ->
    "4.5.1".

gpb_version_as_list() ->
    [4,5,1].
